import Typewriter from 'typewriter-effect';

export default function Landing() {
    return (
        <div className="auth-parent">
            <div className="panel">
                <div className="paneltext">
                <Typewriter
                    options={{
                        strings: ['William Toth OS Copyright (c) 2022 Release 1.0'],
                        autoStart: true,
                        loop: true,
                    }}
                    onInit={(typewriter) => {
                        typewriter.typeString('William Toth OS')
                          .pauseFor(2500)
                          .deleteAll()
                          .callFunction(() => {
                            console.log('All strings were deleted');
                          })
                          .start();
                      }}
                />
                </div>
            </div>
        </div>
    )
}
